var getUrlVars=function(){var d=[],c;var a=window.location.href.slice(window.location.href.indexOf("?")+1).split("&");for(var b=0;b<a.length;b++){c=a[b].split("=");d.push(c[0]);d[c[0]]=c[1]}return d};var mapfixed=function(){setTimeout(function(){center=map1.getCenter();google.maps.event.trigger(map1,"resize");map1.setCenter(center);center=map2.getCenter();google.maps.event.trigger(map2,"resize");map2.setCenter(center)},100)};function addCommas(b){if(b){b=b.toString();b=b.replace(/,/g,"");b+="";x=b.split(".");x1=x[0];x2=x.length>1?"."+x[1]:"";var a=/(\d+)(\d{3})/;while(a.test(x1)){x1=x1.replace(a,"$1,$2")}return x1+x2}else{return""}};